import React, { Component } from 'react';
import '../App.css';
import logo from '../BrainFlix-Sprint-1/4.0 - Assets/Logo/Logo-brainflix.png'

class Nav extends Component {
  render() {
    return (
      <div className="Nav">
        <img className="Nav__logo" src={logo} alt="logo"/>
        <input type="text" className="Nav__search"></input>
        <button className="Nav__uploadBtn"></button>
        {/* <img className="Nav__profile" src="../../BrainFlix-Sprint-1/4.0 - Assets/Images/Mohan-muruge.jpg" alt="profilePicture" /> */}
      </div>
    )
  }
}

export default Nav
